import React, { useState } from "react";

const Nurses = () => {
  const [nurses, setNurses] = useState([
    {
      id: 1,
      name: "Mary Johnson",
      email: "mary.johnson@example.com",
      phone: "123-456-7890",
      clientsAssigned: 5,
      status: "Active",
      lastActivity: "Checked in with client - Jan 10, 2025",
    },
    {
      id: 2,
      name: "Peter Smith",
      email: "peter.smith@example.com",
      phone: "987-654-3210",
      clientsAssigned: 3,
      status: "Inactive",
      lastActivity: "Consultation completed - Dec 15, 2024",
    },
    // Add more nurse data as needed
  ]);

  const [searchTerm, setSearchTerm] = useState("");
  const [currentPage, setCurrentPage] = useState(1);
  const [itemsPerPage] = useState(5);
  const [sortConfig, setSortConfig] = useState(null);

  // Filtered nurses for search
  const filteredNurses = nurses.filter((nurse) =>
    nurse.name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  // Sorting functionality
  const sortedNurses = [...filteredNurses].sort((a, b) => {
    if (!sortConfig) return 0;
    const { key, direction } = sortConfig;
    if (a[key] < b[key]) return direction === "ascending" ? -1 : 1;
    if (a[key] > b[key]) return direction === "ascending" ? 1 : -1;
    return 0;
  });

  // Pagination
  const indexOfLastItem = currentPage * itemsPerPage;
  const indexOfFirstItem = indexOfLastItem - itemsPerPage;
  const currentNurses = sortedNurses.slice(indexOfFirstItem, indexOfLastItem);

  const handleSearch = (e) => setSearchTerm(e.target.value);

  const handleSort = (key) => {
    let direction = "ascending";
    if (sortConfig && sortConfig.key === key && sortConfig.direction === "ascending") {
      direction = "descending";
    }
    setSortConfig({ key, direction });
  };

  const handlePageChange = (pageNumber) => setCurrentPage(pageNumber);

  const handleAssignClient = () => {
    alert("Assign client functionality coming soon!");
  };

  const handleExport = () => {
    alert("Exporting data...");
  };

  return (
    <div className="max-w-5xl mx-auto mt-16 px-8 bg-gray-50 shadow-lg rounded-lg pb-6">
      {/* Page Title */}
      <div className="text-center py-4 border-b border-gray-300">
        <h1 className="text-4xl font-semibold text-blue-700">Nurse Management</h1>
        <p className="text-gray-600">Overview and tools to manage nurses effectively</p>
      </div>

      {/* Search Bar */}
      <div className="flex justify-between items-center mt-6 px-4">
        <input
          type="text"
          placeholder="Search nurses by name..."
          value={searchTerm}
          onChange={handleSearch}
          className="border border-gray-400 rounded-md px-4 py-2 flex-grow mr-4"
        />
        <button
          onClick={() => alert("Add New Nurse functionality coming soon!")}
          className="bg-blue-600 text-white px-6 py-2 rounded-md shadow-md hover:bg-blue-700"
        >
          Add Nurse
        </button>
      </div>

      {/* Nurses List */}
      <div className="mt-6 px-4">
        {currentNurses.map((nurse) => (
          <div
            key={nurse.id}
            className="bg-white p-4 mb-4 rounded-md shadow-md flex justify-between items-center hover:shadow-lg transition"
          >
            <div>
              <h2 className="text-lg font-semibold text-gray-800">{nurse.name}</h2>
              <p className="text-sm text-gray-600">
                {nurse.email} | {nurse.phone}
              </p>
              <p className="text-sm text-gray-500">
                Last Activity: {nurse.lastActivity}
              </p>
            </div>
            <div className="text-right">
              <p
                className={`text-sm font-bold ${
                  nurse.status === "Active"
                    ? "text-green-500"
                    : "text-gray-500"
                }`}
              >
                {nurse.status}
              </p>
              <p className="text-sm text-gray-700">
                Clients Assigned: {nurse.clientsAssigned}
              </p>
              <div className="mt-2 flex space-x-2">
                <button
                  onClick={() => alert(`Viewing profile for ${nurse.name}`)}
                  className="text-blue-600 text-sm hover:underline"
                >
                  View
                </button>
                <button
                  onClick={() => alert(`Editing profile for ${nurse.name}`)}
                  className="text-green-600 text-sm hover:underline"
                >
                  Edit
                </button>
              </div>
            </div>
          </div>
        ))}
      </div>

      {/* Bulk Actions */}
      <div className="flex justify-between items-center mt-6 px-4">
        <button
          onClick={handleAssignClient}
          className="bg-gray-600 text-white px-4 py-2 rounded-md hover:bg-gray-700"
        >
          Assign Client
        </button>
        <button
          onClick={handleExport}
          className="bg-gray-600 text-white px-4 py-2 rounded-md hover:bg-gray-700"
        >
          Export CSV
        </button>
      </div>

      {/* Pagination */}
      <div className="flex justify-center items-center mt-6 space-x-2">
        {[...Array(Math.ceil(filteredNurses.length / itemsPerPage)).keys()].map(
          (number) => (
            <button
              key={number}
              onClick={() => handlePageChange(number + 1)}
              className={`px-4 py-2 rounded-md text-sm font-semibold ${
                currentPage === number + 1
                  ? "bg-blue-600 text-white"
                  : "bg-gray-200 text-gray-700 hover:bg-gray-300"
              }`}
            >
              {number + 1}
            </button>
          )
        )}
      </div>
    </div>
  );
};

export default Nurses;
